//SPDX-License-Identifier: UNLICENSED

// Solidity files have to start with this pragma.
// It will be used by the Solidity compiler to validate its version.
pragma solidity ^0.8.9;
import "hardhat/console.sol";
library YourLibrary {
    struct Data {
        uint256 value;
    }

    function modifyData(Data memory data) internal pure {
        data.value = data.value + 1;
    }
}
// This is the main building block for smart contracts.
contract Token {
    // Some string type variables to identify the token.
    string public name = "My Hardhat Token";
    string public symbol = "MHT";

    // The fixed amount of tokens, stored in an unsigned integer type variable.
    uint256 public totalSupply = 1000000;

    // An address type variable is used to store ethereum accounts.
    address public owner;

    // A mapping is a key/value map. Here we store each account's balance.
    mapping(address => uint256) balances;

    // The Transfer event helps off-chain applications understand
    // what happens within your contract.
    event Transfer(address indexed _from, address indexed _to, uint256 _value);

    /**
     * Contract initialization.
     */
    constructor() {
        // The totalSupply is assigned to the transaction sender, which is the
        // account that is deploying the contract.
        balances[msg.sender] = totalSupply;
        owner = msg.sender;
    }

    /**
     * A function to transfer tokens.
     *
     * The `external` modifier makes a function *only* callable from *outside*
     * the contract.
     */
    function transfer(address to, uint256 amount) external {
        // Check if the transaction sender has enough tokens.
        // If `require`'s first argument evaluates to `false` then the
        // transaction will revert.
        require(balances[msg.sender] >= amount, "Not enough tokens");

        // Transfer the amount.
        balances[msg.sender] -= amount;
        balances[to] += amount;

        // Notify off-chain applications of the transfer.
        emit Transfer(msg.sender, to, amount);
    }

    /**
     * Read only function to retrieve the token balance of a given account.
     *
     * The `view` modifier indicates that it doesn't modify the contract's
     * state, which allows us to call it without executing a transaction.
     */
    function balanceOf(address account) external view returns (uint256) {
        return balances[account];
    }
   function storeAndLoadValue() public pure returns (uint) {
        uint storedValue;

        assembly {
            // Store the value 42 at memory position 0x20 (32 bytes into memory).
            mstore(0x20, 42)

            // Load the 32-byte word from memory position 0x20.
            storedValue := mload(0x20)
        }

        return storedValue; // Should return 42
    }
    // function hashStrings(string memory str1, string memory str2) public pure returns (bytes32 hash1, bytes32 hash2) {
    //     hash1 = keccak256(abi.encodePacked(str1, str2));
    //     // hash2 = keccak256(add(str1, 32), mload(str2));//add(namePrefix, 32), mload(namePrefix))
    // }

    function getCreate2Prefix(address deployer) external pure returns (bytes32 create2Prefix) {
        assembly {
        create2Prefix := or(deployer, 0xff0000000000000000000000000000000000000000)
        }
    }
    function updateData() public pure returns(uint256) {
        YourLibrary.Data memory data;
        data.value = 100;
        YourLibrary.modifyData(data);
        return data.value;
    }
    function getData() public pure returns(uint256) {
        uint256 a = 10;
        uint256 b = 100;
        uint256 c;
        c = a * b / 10 ** 4 * 10; 
        return c;
    }

    function AA() public view {
        console.log("AA: ", msg.sender);
        BB();
    }

    function BB() public view {
        console.log("BB: ", msg.sender);
        console.log("this:", address(this));
    }

    enum OrderType {
        // @dev MarketSwap: swap token A to token B at the current market price
        // the order will be cancelled if the minOutputAmount cannot be fulfilled
        MarketSwap,
        // @dev LimitSwap: swap token A to token B if the minOutputAmount can be fulfilled
        LimitSwap,
        // @dev MarketIncrease: increase position at the current market price
        // the order will be cancelled if the position cannot be increased at the acceptablePrice
        MarketIncrease,
        // @dev LimitIncrease: increase position if the triggerPrice is reached and the acceptablePrice can be fulfilled
        LimitIncrease,
        // @dev MarketDecrease: decrease position at the current market price
        // the order will be cancelled if the position cannot be decreased at the acceptablePrice
        MarketDecrease,
        // @dev LimitDecrease: decrease position if the triggerPrice is reached and the acceptablePrice can be fulfilled
        LimitDecrease,
        // @dev StopLossDecrease: decrease position if the triggerPrice is reached and the acceptablePrice can be fulfilled
        StopLossDecrease,
        // @dev Liquidation: allows liquidation of positions if the criteria for liquidation are met
        Liquidation
    }
    struct CreateOrderParams {
        CreateOrderParamsAddresses addresses;
        CreateOrderParamsNumbers numbers;
        OrderType orderType;
        DecreasePositionSwapType decreasePositionSwapType;
        bool isLong;
        bool shouldUnwrapNativeToken;
        bytes32 referralCode;
    }
    struct CreateOrderParamsAddresses {
        address receiver;
        address callbackContract;
        address uiFeeReceiver;
        address market;
        address initialCollateralToken;
        address[] swapPath;
    }

    // @param sizeDeltaUsd for order.sizeDeltaUsd
    // @param triggerPrice for order.triggerPrice
    // @param acceptablePrice for order.acceptablePrice
    // @param executionFee for order.executionFee
    // @param callbackGasLimit for order.callbackGasLimit
    // @param minOutputAmount for order.minOutputAmount
    struct CreateOrderParamsNumbers {
        uint256 sizeDeltaUsd;
        uint256 initialCollateralDeltaAmount;
        uint256 triggerPrice;
        uint256 acceptablePrice;
        uint256 executionFee;
        uint256 callbackGasLimit;
        uint256 minOutputAmount;
    }

    enum DecreasePositionSwapType {
        NoSwap,
        SwapPnlTokenToCollateralToken,
        SwapCollateralTokenToPnlToken
    }

    function encodeStruct(CreateOrderParams memory data) public pure returns(bytes memory) {
        return abi.encode(data);
    }

    function encode() public pure returns(bytes memory) {
        // return keccak256(abi.encode("MAX_PNL_FACTOR_FOR_TRADERS"));
        return abi.encode("MAX_PNL_FACTOR_FOR_TRADERS");
    } 

    function encodePack() public pure returns(bytes memory) {
        // return keccak256(abi.encodePacked("MAX_PNL_FACTOR_FOR_TRADERS"));
        return abi.encodePacked("MAX_PNL_FACTOR_FOR_TRADERS");
    }

    function encodes() public pure returns(bytes memory, bytes memory) {
        // return keccak256(abi.encode("MAX_PNL_FACTOR_FOR_TRADERS"));
        uint256 a = 10;
        uint256 b = 11;
        uint256 c = 12;

        bytes memory data1 = abi.encode(a, b, c);
        bytes memory data2 = abi.encode(a, b);
        bytes memory data3 = abi.encode(data2, c);
        // console.log("data1", data1);
        // console.log("data3", data3);
        return( data1, data3);
    } 

    uint256[] public myArray;

    // Function to add elements to the array
    function addElement(uint256 element) public {
        myArray.push(element);
    }

    // Function to remove all members of the array
    function removeAllMembers() public {
        // Reset the array to an empty array
        delete myArray;
    }

    // Function to get the length of the array
    function getArrayLength() public view returns (uint256) {
        return myArray.length;
    }

}

